        <Container>
            <Grid container>
                <Grid item xs={12} sm={12} md={8}>
                    <Header
                        title={content.title}
                        type={content.type}
                        thumbnail={content.thumbnail}
                    />
                </Grid>
                <Grid item xs={12} sm={12} md={4}>

                </Grid>

            </Grid>

        </Container>
    );
}


export default Detail;
